var tipuesearch = {"pages": [{'title': 'About', 'text': '\n 兩人小組:40823247、 40823248 \n 小組倉儲: https://github.com/40823247/stage1-bg21 \n 小組網頁: https://40823247.github.io/stage1-bg21/content/index.html \n ------------------------------------------------------------------------------- \n 四人小組: 40823214 、 40823225 、40823247、40823248 \n 小組倉儲: https://github.com/40823225/stage2-bg6 \n 小組網頁: https://40823225.github.io/stage2-bg6/content/index.html \n ------------------------------------------------------------------------------- \n 八人小組: 40823211 、40823214、 40823216 、 40823218 、40823225、 40823238 、40823247、40823248 \n 小組倉儲: https://github.com/40823225/stage3-bg6 \n 小組網站: https://40823225.github.io/stage3-bg6/content/About.html \n', 'tags': '', 'url': 'About.html'}, {'title': 'Stage1', 'text': '', 'tags': '', 'url': 'Stage1.html'}, {'title': 'W1', 'text': '架設網站、下載SHAREX、錄製影片。 \n', 'tags': '', 'url': 'W1.html'}, {'title': 'W2', 'text': '選定小組題目，題目為自動旋轉烤肉機。 \n', 'tags': '', 'url': 'W2.html'}, {'title': 'W3', 'text': '組員開始繪製小組題目，討論設計的方向。 \n', 'tags': '', 'url': 'W3.html'}, {'title': 'W4', 'text': '利用coppeliasim模擬全自動旋轉烤肉機運作方式。 \n stage1bg21 \n', 'tags': '', 'url': 'W4.html'}, {'title': '自動旋轉烤肉機', 'text': '本組主題為:自動旋轉烤肉機 \n 設計動機:因為手動烤肉較麻煩，因此想透過電動的方式來烤肉。 \n 組員:40823247、40823248 \n 48號負責繪圖，我負責程式模擬以及網站的維護。 \n \n 參考: \n \n 以下為我們的設計完成圖: \n \n 下圖為轉軸的設定: \n \n', 'tags': '', 'url': '自動旋轉烤肉機.html'}, {'title': 'Stage2', 'text': '\n', 'tags': '', 'url': 'Stage2.html'}, {'title': 'W5', 'text': '日期:2021/3/26 \n 時間:協同產品設計實習課程中 \n 事件:當時老師出給大家一個挑戰，讓大家透過python寫出一個程式，透過這個程式，批量修改mp4檔的檔案名稱，以及顯示mp4檔案的長度。 \n 回家後開始研究了一些資料，發現有python裡面，有OS模塊中的指令能做到的到。 \n 參考資料: \n python批量修改文件名 \n python批量讀取資料夾檔案、修改檔案 \n 日期:2021/3/27 \n 研究了一個多小時，發現還是不太懂，但至少知道兩個參考資料的區別在哪，之後會再做研究，下面這張圖是我用白窗研究python修改檔名，跟讀取檔案指令的程式。 \n \n', 'tags': '', 'url': 'W5.html'}, {'title': 'W6', 'text': '\n 決定小組題目為:多功能腳踏車衝擊測試機 \n 4人小組組員:40823214、40823225、40823247、40823248 \n 分工: \n 繪圖:40823214 \n 網站管理:40823225 \n 程式模擬:40823247、40823248 \n 參考資料: 台灣自行車產業標準 \n', 'tags': '', 'url': 'W6.html'}, {'title': 'W7', 'text': '此時仍在繪製段，繪製半成品如下 \n \n', 'tags': '', 'url': 'W7.html'}, {'title': 'W8', 'text': '程式模擬 \n 此為程式模擬影片，使用coppeliasim時模擬出現問題，仍在找詳細原因 \n 目前改用invertor模擬，以下為模擬影片。 \n 1.輪胎衝擊測試模擬測試 \n \n 2.腳踏車架衝擊模擬測試 \n \n 3.腳踏車前叉衝擊模擬測試 \n \n', 'tags': '', 'url': 'W8.html'}, {'title': 'W9', 'text': '本週為期中報告週，stage2也到了尾聲，與stge1的自動旋轉烤肉機相比，這次我們挑戰了更高難度的作品，多功能腳踏車衝擊測試機。以下是W9的主題總結影片。 \n \n', 'tags': '', 'url': 'W9.html'}, {'title': '多功能腳踏車衝擊測試機', 'text': '本次主題為:多功能腳踏車衝擊測試機 \n stage2為4人小組，由4個組員組成一個團隊，共同設計一個產品。組員中有各自擅長的地方，擅長CAD的組員負責繪圖，擅長寫程式的去模擬成品，大家發揮各自所長，老師負責打分數，貢獻的程度取決於付出了多少。 \n 四人小組成員有:40823214、40823225、40823247、40823248 \n 14負責繪圖、25負責網站編排，47跟48負責模擬程式。 \n 完成圖 \n \n 以下為模擬影片: \n 1.車架衝擊模擬 \n \n 2.前叉衝擊模擬 \n \n 3.輪胎衝擊模擬 \n \n', 'tags': '', 'url': '多功能腳踏車衝擊測試機.html'}, {'title': 'stage3', 'text': '第三階段工作流程: \n 1) 動態網站維護與轉檔, 2) 倉儲內容改版與同步, 3) 雲端主機內容同步, 4) 提出構想並參與討論, 5) 文獻搜尋, 6) 參數式零組件繪圖, 7) 零組件轉檔, 8) 機電系統模擬與控制, 9) 專案報告編寫與 10) 網際簡報編寫 \n 暫定主題:機械手臂( Industrial robot) \n 我屬於程式模擬的部分。 \n', 'tags': '', 'url': 'stage3.html'}, {'title': 'W10', 'text': '上網找的資料顯示coppeliasim上有一個編輯程式的選項 \n 參考資料: https://zhuanlan.zhihu.com/p/105960079 \n 4/27(二)因為繪圖部分還沒畫好，今天暫時用coppeliasim裡的機械手臂模型來模擬。 \n 設定的主體上連結每個零件，各零件之間有可以旋轉的軸，以及連結的命令區塊 \n 下圖為參考的機械手臂: \n \n 這是機械手臂的零件圖: \n \n \n', 'tags': '', 'url': 'W10.html'}, {'title': 'W11', 'text': '本週仍在找相關資料，目前還是沒找到控制機械手臂的程式該怎麼編譯... \n 參考資料: \n https://blog.csdn.net/qq_29696095/article/details/104406971 https://blog.csdn.net/qq_29696095/article/details/104474081 https://www.coppeliarobotics.com/helpFiles/en/inverseKinematicsTutorial.htm \n http://mde.tw/cd2021/downloads/V-REP%20Lecture.pdf http://hades.mech.northwestern.edu/index.php/CoppeliaSim_Introduction https://www.coppeliarobotics.com/helpFiles/index.html http://mde.tw/cd2021/content/V-rep.html \n', 'tags': '', 'url': 'W11.html'}, {'title': 'W12', 'text': '5/17組員完成了程式模擬 \n 此為檔案載點: \n https://drive.google.com/file/d/1FErGMzyfP5MTvf8cLc1Ox2xHJhuDN1XH/view?usp=sharing \n -5/18開始測試程式，可以順利執行- \n \n 解壓縮檔案後，將此api.py丟到白窗測試程式 \n \n 若要操控自己電腦的coppeliasim裡的機構，將ip位址改為127.0.0.1，點選go即可執行。 \n \n ------------(我是分隔線)-------------- \n 按鍵A為主軸順時針旋轉 \n 按鍵B為主軸逆時針旋轉 \n 按鍵W為大臂向上 \n 按鍵S為大臂向下 \n 按鍵E為小臂向上 \n 按鍵D為小臂向下 \n 按鍵R為小臂旋轉 \n 按鍵J為手肘向上 \n 按鍵K為手肘向下 \n ------------(我是分隔線)--------------- \n 此為程式碼: \n \n \n # File created by Thibaut Royer, Epitech school \n # thibaut1.royer@epitech.eu \n # It intends to be an example program for the "Two wheels, one arm" educative project. \n \xa0 \xa0 \n import   sim as vrep \n import   math \n import   random \n import   time \n import   keyboard \n \xa0 \xa0 \n print   ( \'Start\' ) \n \xa0 \xa0 \n # Close eventual old connections \n vrep.simxFinish( - 1 ) \n # Connect to V-REP remote server \n clientID  =   vrep.simxStart( \'192.168.0.4\' ,  19997 ,  True ,  True ,  5000 ,  5 ) \n \xa0 \xa0 \n if   clientID ! =   - 1 : \n \xa0\xa0\xa0\xa0 print   ( \'Connected to remote API server\' ) \n \xa0\xa0\xa0\xa0\xa0 \xa0 \n \xa0\xa0\xa0\xa0 res  =   vrep.simxAddStatusbarMessage( \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 clientID,  "40823218" , \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 vrep.simx_opmode_oneshot) \n \xa0\xa0\xa0\xa0 if   res  not   in   (vrep.simx_return_ok, vrep.simx_return_novalue_flag): \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 print ( "Could not add a message to the status bar." ) \n \xa0 \xa0 \n \xa0\xa0\xa0\xa0 # Communication operating mode with the remote API : wait for its answer before continuing (blocking mode) \n \xa0\xa0\xa0\xa0 # http://www.coppeliarobotics.com/helpFiles/en/remoteApiConstants.htm \n \xa0\xa0\xa0\xa0 opmode  =   vrep.simx_opmode_oneshot_wait \n \xa0\xa0\xa0\xa0 STREAMING  =   vrep.simx_opmode_streaming \n \xa0 \xa0 \n \xa0\xa0\xa0\xa0 # Try to retrieve motors and robot handlers \n \xa0\xa0\xa0\xa0 # http://www.coppeliarobotics.com/helpFiles/en/remoteApiFunctionsPython.htm#simxGetObjectHandle \n \xa0\xa0\xa0\xa0 vrep.simxStartSimulation(clientID, opmode) \n \xa0\xa0\xa0\xa0 ret,base_handle = vrep.simxGetObjectHandle(clientID, "joint1" ,opmode) \n \xa0\xa0\xa0\xa0 ret,bottom_handle = vrep.simxGetObjectHandle(clientID, "joint2" ,opmode) \n \xa0\xa0\xa0\xa0 ret,top_handle = vrep.simxGetObjectHandle(clientID, "joint3" ,opmode) \n \xa0\xa0\xa0\xa0 ret,rotate_handle = vrep.simxGetObjectHandle(clientID, "joint4" ,opmode) \n \xa0\xa0\xa0\xa0 ret,wrist_handle = vrep.simxGetObjectHandle(clientID, "joint5" ,opmode) \n \xa0\xa0\xa0\xa0 while   True : \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 #Clockwise \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 if   keyboard.is_pressed( "a" ): \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 vrep.simxSetJointTargetVelocity(clientID,base_handle, 0.2 ,opmode) \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 #anti-Clockwise  \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 if   keyboard.is_pressed( "f" ): \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 vrep.simxSetJointTargetVelocity(clientID,base_handle, - 0.2 ,opmode) \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 #bottom_handle up \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 if   keyboard.is_pressed ( "w" ): \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 vrep.simxSetJointTargetVelocity(clientID,bottom_handle, 0.2 ,opmode) \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 #bottom_handle down \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 if   keyboard.is_pressed ( "s" ): \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 vrep.simxSetJointTargetVelocity(clientID,bottom_handle, - 0.2 ,opmode) \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 #top_handle up \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 if   keyboard.is_pressed ( "e" ): \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 vrep.simxSetJointTargetVelocity(clientID,top_handle, 0.2 ,opmode) \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 #top_handle down \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 if   keyboard.is_pressed ( "d" ): \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 vrep.simxSetJointTargetVelocity(clientID,top_handle, - 0.2 ,opmode) \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 #rotate \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 if   keyboard.is_pressed ( "r" ): \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 vrep.simxSetJointTargetVelocity(clientID,rotate_handle, 0.2 ,opmode) \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 #wrist_handle left \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 if   keyboard.is_pressed ( "j" ): \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 vrep.simxSetJointTargetVelocity(clientID,wrist_handle, 0.2 ,opmode) \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 #wrist_handle right \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 if   keyboard.is_pressed ( "k" ): \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 vrep.simxSetJointTargetVelocity(clientID,wrist_handle, - 0.2 ,opmode) \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 #stop \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 if   keyboard.is_pressed ( "space" ): \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 vrep.simxSetJointTargetVelocity(clientID,base_handle, 0 ,opmode) \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 vrep.simxSetJointTargetVelocity(clientID,bottom_handle, 0 ,opmode) \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 vrep.simxSetJointTargetVelocity(clientID,top_handle, 0 ,opmode) \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 vrep.simxSetJointTargetVelocity(clientID,rotate_handle, 0 ,opmode) \n \xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0\xa0 vrep.simxSetJointTargetVelocity(clientID,wrist_handle, 0 ,opmode) \n \xa0 \xa0 \n \xa0 \xa0 \n else : \n \xa0\xa0\xa0\xa0 print   ( \'Failed connecting to remote API server\' ) \n \xa0\xa0\xa0\xa0 print   ( \'End\' ) \n \n \n \n 此處的意思為呼叫這些程式，因為要執行接下來的程式碼時會用到 \n \n 修改此處的id位址會影響你要操控的電腦位址 \n \n 此處為定義程式指令和零件的關係和模式，後方的joint就是指coppeliasim的零件 \n \n 這串的意思是，當你按下鍵盤的按鍵，對應的已被你定義關係的零件就會根據你下的指令作動 \n \n 下載老師提供的壓縮檔: http://mde.tw/cd2021/content/task2.html \n \n \n', 'tags': '', 'url': 'W12.html'}, {'title': 'Team', 'text': '', 'tags': '', 'url': 'Team.html'}, {'title': 'Mission', 'text': '1.請在各組組長的 Github 帳號下建立各組的分組網站, 惟在 W1 進行各班定組序過程中, 發現即便採用 Ethercalc 以網際協同方式同步讓各班自選組員填入兩兩成組的學員學號, 但仍缺人工或自動定各班組序的有效方案, 在此責成各組在進行自選的協同產品開發項目之際 (W2-W4), 將此議題列為必選的題目之一, 詳細說明各組認為最有效率的第一階段與訂定組序的方法及流程。 \n 2.此外, 為了讓各組在 stage1 分組協同實習過程, 能透過網誌發表各組組員在 W2-W4 過程中的各項作為與心得報告, 說明可利用 Leo Editor 協助 CMSiMDE 中的 Pelican 發表協同網誌, 其目的是讓各分組在協同期間, 能完整呈現各階段所留下的網誌紀錄. 但此方式必須熟悉 Leo Editor 的操作, 因此有關透過 Pelican 建立協同網誌一事, 除利用 Leo Editor 協助設定並建立 pelican 網誌外, 也將此議題列為各組在 Stage1 協同產品設計流程中必選題目之二, 請各組詳細說明採用或不採用 Leo Editor 的兩種情況下, 各組員在設定與建立協同網誌的過程所可能遭遇或產生的問題與解決方案。 各組員在期末前依照老師的指示完成task1、2、3。   \n', 'tags': '', 'url': 'Mission.html'}, {'title': 'task1', 'text': 'task1: http://mde.tw/cd2021/content/task1.html \n', 'tags': '', 'url': 'task1.html'}, {'title': 'task2', 'text': 'task2: http://mde.tw/cd2021/content/task2.html \n', 'tags': '', 'url': 'task2.html'}, {'title': 'task3', 'text': 'task3: http://mde.tw/cd2021/content/task3.html \n', 'tags': '', 'url': 'task3.html'}, {'title': 'Others', 'text': '', 'tags': '', 'url': 'Others.html'}, {'title': 'Fix cmsimde', 'text': '1.進入 https://github.com/mdecourse/cmsimde \n 2.點commits \n \n 3.找到最新版本，點旁邊那串 \n \n 4.把網址後面那串複製下來 \n \n 5.進小黑窗，到cmsimde，輸入git checkout 把剛剛那串貼上，按ENTER \n \n 6.回到cd2021，PUSH一次 \n', 'tags': '', 'url': 'Fix cmsimde.html'}, {'title': 'Update cmsimde', 'text': '1.打開黑窗，進入cmsimde \n 2.輸入git pull origin master，按enter \n \n 3.打開資料夾>cd2021>cmsimde>up_dir \n 4.複製acp.bat、cms.bat、http-server.py、localhost.crt、localhost.key \n 5.回到cd2021，貼上，系統會問你要不要取代http-server.py，按取代檔案 \n \n 用完之後，以後想要打開遠端，只需要進到cd2021，輸入cms即可。 \n 要推送的話，則是進到cd2021，輸入acp "上傳標題"即可。 \n', 'tags': '', 'url': 'Update cmsimde.html'}, {'title': 'leo', 'text': '-打開blog、reveal簡報檔案- \n 1.打開leo \n 2.點選file>open-outline \n \n 3.點選pelican就是打開blog檔案，點選reveal就是簡報檔案。 \n \n 編輯leo小技巧 \n 新增分目錄:點一下主目錄，按ctrl+i。 \n 將同排的目錄變成分目錄:點一下要動的目錄，按ctrl+r。 \n \n', 'tags': '', 'url': 'leo.html'}, {'title': 'github提交沒有顯示頭像', 'text': '參考資料: \n 1. https://blog.csdn.net/Liven_Zhu/article/details/80800162 \n 2. https://www.jianshu.com/p/76eecd2ecaf6 \n 提交資料後若沒有顯示頭像，有可能使push的資料無法顯示在網頁上 \n 解決辦法: \n 1.打開黑窗 \n 2.進到出現問題的目錄 \n 3. git config -- global  user.name <你的github名稱 >  \n 4.git config -- global  user.email <你的github郵件 > \n \n 5.這樣就設定完了，輸入git show檢查。 \n \n \n', 'tags': '', 'url': 'github提交沒有顯示頭像.html'}, {'title': '組員合併倉儲產生衝突', 'text': '參考資料: https://gitbook.tw/chapters/github/fail-to-push.html \n 方法1 \n 1.打開黑窗 \n 2.到衝突目錄中(例如 推送A倉儲錯誤，就進入A倉儲的目錄中) \n 3.輸入git pull \n 4.輸入git add . \n 5.輸入git commit -m "修理倉儲合併衝突" \n 6.輸入git push \n (若是照老師的推送方法就用acp "修理倉儲合併衝突") \n 方法2 \n ( 注意! 此方法是強制性推送，你的推送資料會把其他協同者的推送資料蓋掉， 請確保你的資料包含其他協同者的最新推送資料再用這個程式碼! ) \n 1.打開黑窗 \n 2.到衝突目錄中(例如 推送A倉儲錯誤，就進入A倉儲的目錄中) \n 3.輸入git add . \n 4.輸入git commit -m "修理倉儲合併衝突" \n 5.輸入git push -f \n \xa0 \n', 'tags': '', 'url': '組員合併倉儲產生衝突.html'}, {'title': 'Videos', 'text': '1.介紹創立本網站的目的，以及網站內容。 \n \n 2.小組主題報告影片，內容是小組的設計成果。 \n \n 3.w5研究python指令的影片，此影片沒有聲音，拍此影片的目的是紀錄我的學習過程。 \n \n 4.此為stage2分組網站第八週介紹影片。 \n', 'tags': '', 'url': 'Videos.html'}]};